import '../App.css';
import React from 'react';
import Database from '../database.js';
import { NavLink } from "react-router-dom";

function Navbar() {
    return (
        <div>
            {/* <a href={Database}>Database</a> */}
            <NavLink to="/database">
                Database
            </NavLink>
        </div>
    );
}

export default Navbar;
